import './../App.css';

export default function Header() {
    return (
        <nav id="header-bar">
            <a className="header-option" id="about-header-option" href="#about-section"> About </a>
            <a className="header-option" id="experience-header-option" href="#professional-experience-section"> Professional Experience </a>
            <a className="header-option" id="experience-header-option" href="#project-experience-section"> Project Experience </a>
            <a className="header-option" id="education-header-option" href="#education-section"> Education </a>
        </nav>
    )
}
